public Double remove(int index) {
  ensureIsMutable();
  ensureIndexInRange(index);
  double value = array[index];
  if (index < size - 1) {
    System.arraycopy(array, index + 1, array, index, size - index);
  }
  size--;
  modCount++;
  return value;
}

